const e=`{"head": {"author": "Mikhail Bulgakov", "title": "The Master and Margarita"}, "body": [{"t": "h2", "c": "CHAPTER 29", "p": 7763}, {"t": "h2", "c": "The Fate of the Master and Margarita is decided", "p": 7764}, {"t": "text", "c": ["At sunset, high over the city, on the stone terrace of one of the most beautiful houses in Moscow, a house built about a hundred and fifty years ago, there were two: Woland and Azazello.", "They could not be seen from the street below, because they were hidden from unwanted eyes by a balustrade with plaster vases and plaster flowers.", "But they could see the city almost to its very edges."], "p": 3595}, {"t": "text", "c": ["Woland was sitting on a folding stool, dressed in his black soutane. His long and broad sword was stuck vertically into a crack between two flags of the terrace so as to make a sundial.", "The shadow of the sword lengthened slowly and steadily, creeping towards the black shoes on Satan's feet.", "Resting his sharp chin on his fist, hunched on the stool with one leg drawn under him, Woland stared fixedly' at the endless collection of palaces, gigantic buildings and little hovels destined to be pulled down.", "Azazello, having parted with his modern attire - that is, jacket, bowler hat and patent-leather shoes - and dressed, like Woland, in black, stood motionless not far from his sovereign, like him with his eyes fixed on the city."], "p": 3596}, {"t": "text", "c": ["Woland began to speak:"], "p": 3597}, {"t": "text", "c": ["'Such an interesting city, is it not?'"], "p": 3598}, {"t": "text", "c": ["Azazello stirred and replied respectfully: 'I like Rome better, Messire.'"], "p": 3600}, {"t": "text", "c": ["'Yes, it's a matter of taste,' replied Woland. After a while, his voice resounded again: 'And what is that smoke there on the boulevard?'"], "p": 3603}, {"t": "text", "c": ["That is Griboedov's burning,' replied Azazello."], "p": 3604}, {"t": "text", "c": ["'It must be supposed that that inseparable pair, Koroviev and Behemoth, stopped by there?'"], "p": 3605}, {"t": "text", "c": ["'Of that there can be no doubt, Messire.'"], "p": 3606}, {"t": "text", "c": ["Again silence fell, and the two on the terrace gazed at the fragmented, dazzling sunlight in the upper-floor windows of the huge buildings facing west.", "Woland's eye burned like one of those windows, though Woland had his back to the sunset."], "p": 3607}, {"t": "text", "c": ["But here something made Woland turn his attention to the round tower behind him on the roof.", "From its wall stepped a tattered, clay-covered, sullen man in a chiton, in home-made sandals, black-bearded."], "p": 3608}, {"t": "text", "c": ["'Hah!' exclaimed Woland, looking mockingly at the newcomer. 'Least of all would I expect you here!", "What have you come with, uninvited guest?'"], "p": 3609}, {"t": "text", "c": ["'I have come to see you, spirit of evil and sovereign of shadows,' the newcomer replied, glowering inimically at Woland."], "p": 3610}, {"t": "text", "c": ["\`If you've come to see me, why didn't you wish me a good evening, former tax collector?' Woland said sternly."], "p": 3611}, {"t": "text", "c": ["\`Because I don't wish you a good anything,' the newcomer replied insolendy."], "p": 3612}, {"t": "text", "c": ["'But you'll have to reconcile yourself to that,' Woland objected, and a grin twisted his mouth. 'You no sooner appear on the roof than you produce an absurdity, and I'll tell you what it is - it's your intonation.", "You uttered your words as if you don't acknowledge shadows, or evil either.", "Kindly consider the question: what would your good do if evil did not exist, and what would the earth look like if shadows disappeared from it?", "Shadows are cast by objects and people.", "Here is the shadow of my sword.", "Trees and living beings also have shadows. Do you want to skin the whole earth, tearing all the trees and living things off it, because of your fantasy of enjoying bare light?", "You're a fool.'"], "p": 3613}, {"t": "text", "c": ["'I won't argue with you, old sophist,' replied Matthew Levi."], "p": 3614}, {"t": "text", "c": ["'You also cannot argue with me, for the reason I've already mentioned: you're a fool,' Woland replied and asked: \\"Well, make it short, don't weary me, why have you appeared?'"], "p": 3615}, {"t": "text", "c": ["'He sent me.'"], "p": 3616}, {"t": "text", "c": ["'What did he tell you to say, slave?'"], "p": 3617}, {"t": "text", "c": ["'I'm not a slave,' Matthew Levi replied, growing ever angrier, 'I'm his disciple.'"], "p": 3618}, {"t": "text", "c": ["'You and I speak different languages, as usual,' responded Woland, 'but the things we say don't change for all that.", "And so? ...'"], "p": 3619}, {"t": "text", "c": ["'He has read the master's work,' said Matthew Levi, 'and asks you to take the master with you and reward him with peace.", "Is that hard for you to do, spirit of evil?'"], "p": 3620}, {"t": "text", "c": ["'Nothing is hard for me to do,' answered Woland, 'you know that very well.' He paused and added: 'But why don't you take him with you into the light?'"], "p": 3621}, {"t": "text", "c": ["'He does not deserve the light, he deserves peace,' Levi said in a sorrowful voice."], "p": 3622}, {"t": "text", "c": ["'Tell him it will be done,' Woland replied and added, his eye flashing: 'And leave me immediately.'"], "p": 3623}, {"t": "text", "c": ["'He asks that she who loved him and suffered because of him also be taken with him,' Levi addressed Woland pleadingly for the first time."], "p": 3624}, {"t": "text", "c": ["'We would never have thought of it without you.", "Go.'"], "p": 3625}, {"t": "text", "c": ["Matthew Levi disappeared after that, and Woland called Azazello and ordered him:"], "p": 3626}, {"t": "text", "c": ["'Fly to them and arrange it all.'"], "p": 3627}, {"t": "text", "c": ["Azazello left the terrace, and Woland remained alone. But his solitude did not last.", "Over the flags of the terrace came the sound of footsteps and animated voices, and before Woland stood Koroviev and Behemoth.", "But now the fat fellow had no primus with him, but was loaded with other things. Thus, under his arm he had a small landscape in a gold frame, from one hand hung a half-burnt cook's smock, and in the other he held a whole salmon with skin and tail.", "Koroviev and Behemoth reeked of fire. Behemoth's mug was all sooty and his cap was badly burnt."], "p": 3628}, {"t": "text", "c": ["'Greetings, Messire!' cried the irrepressible pair, and Behemoth waved the salmon."], "p": 3629}, {"t": "text", "c": ["'A fine sight,' said Woland."], "p": 3630}, {"t": "text", "c": ["'Imagine, Messire!' Behemoth cried excitedly and joyfully, 'I was taken for a looter!'"], "p": 3631}, {"t": "text", "c": ["'Judging by the things you've brought,' Woland replied, glancing at the landscape, 'you are a looter!'"], "p": 3632}, {"t": "text", "c": ["'Believe me, Messire ...' Behemoth began in a soulful voice."], "p": 3633}, {"t": "text", "c": ["'No, I don't,' Woland replied curdy."], "p": 3634}, {"t": "text", "c": ["'Messire, I swear, I made heroic efforts to save everything I could, and this is all I was able to rescue.'"], "p": 3635}, {"t": "text", "c": ["'You'd better tell me, why did Griboedov's catch fire?' asked Woland."], "p": 3636}, {"t": "text", "c": ["Both Koroviev and Behemoth spread their arms, raised their eyes to heaven, and Behemoth cried out:"], "p": 3637}, {"t": "text", "c": ["\`I can't conceive why!", "We were sitting there peacefully, perfectly quiet, having a bite to eat...'"], "p": 3638}, {"t": "text", "c": ["'And suddenly - bang, bang!' Koroviev picked up, 'gunshots!", "Crazed with fear, Behemoth and I ran out to the boulevard, our pursuers followed, we rushed to Timiriazev! ...'"], "p": 3639}, {"t": "text", "c": ["'But the sense of duty,' Behemoth put in, 'overcame our shameful fear and we went back.'"], "p": 3640}, {"t": "text", "c": ["'Ah, you went back?' said Woland. 'Well, then of course the building was reduced to ashes.'"], "p": 3641}, {"t": "text", "c": ["To ashes!' Koroviev ruefully confirmed, 'that is, Messire, literally to ashes, as you were pleased to put it so aptly.", "Nothing but embers!'"], "p": 3642}, {"t": "text", "c": ["'I hastened,' Behemoth narrated, 'to the meeting room, the one with the columns, Messire, hoping to bring out something valuable.", "Ah, Messire, my wife, if only I had one, was twenty times in danger of being left a widow!", "But happily, Messire, I'm not married, and, let me tell you, I'm really happy that I'm not.", "Ah, Messire, how can one trade a bachelor's freedom for the burdensome yoke...'"], "p": 3643}, {"t": "text", "c": ["'Again some gibberish gets going,' observed Woland."], "p": 3644}, {"t": "text", "c": ["'I hear and continue,' the cat replied. 'Yes, sir, this landscape here!", "It was impossible to bring anything more out of the meeting room, the flames were beating in my face.", "I ran to the pantry and rescued the salmon.", "I ran to the kitchen and rescued the smock.", "I think, Messire, that I did everything I could, and I don't understand how to explain the sceptical expression on your face.'"], "p": 3645}, {"t": "text", "c": ["'And what did Koroviev do while you were looting?' asked Woland."], "p": 3646}, {"t": "text", "c": ["'I was helping the firemen, Messire,' replied Koroviev, pointing to his torn trousers."], "p": 3647}, {"t": "text", "c": ["'Ah, if so, then of course a new building will have to be built.'"], "p": 3648}, {"t": "text", "c": ["'It will be built, Messire,' Koroviev responded, \`I venture to assure you of that.'"], "p": 3649}, {"t": "text", "c": ["'Well, so it remains for us to wish that it be better than the old one,' observed Woland."], "p": 3650}, {"t": "text", "c": ["'It will be, Messire,' said Koroviev."], "p": 3651}, {"t": "text", "c": ["'You can believe me,' the cat added, 'I'm a regular prophet.'"], "p": 3652}, {"t": "text", "c": ["'In any case, we're here, Messire,' Koroviev reported, 'and await your orders.'"], "p": 3653}, {"t": "text", "c": ["Woland got up from his stool, went over to the balustrade, and alone, silently, his back turned to his retinue, gazed into the distance for a long time.", "Then he stepped away from the edge, lowered himself on to his stool, and said:"], "p": 3654}, {"t": "text", "c": ["'There will be no orders, you have fulfilled all you could, and for the moment I no longer need your services.", "You may rest.", "Right now a storm is coming, the last storm, it will complete all that needs completing, and we'll be on our way.'"], "p": 3655}, {"t": "text", "c": ["\`Very well, Messire,' the two buffoons replied and disappeared somewhere behind the round central tower, which stood in the middle of the terrace."], "p": 3656}, {"t": "text", "c": ["The storm of which Woland had spoken was already gathering on the horizon.", "A black cloud rose in the west and cut off half the sun. Then it covered it entirely.", "The air became cool on the terrace. A little later it turned dark."], "p": 3657}, {"t": "text", "c": ["This darkness which came from the west covered the vast city.", "Bridges and palaces disappeared.", "Everything vanished as if it had never existed in the world.", "One fiery thread ran across the whole sky. Then a thunderclap shook the city.", "It was repeated, and the storm began. Woland could no longer be seen in its gloom."], "p": 3658}]}`;export{e as default};
